var processMeasurement = function(measurements,needle) {
      
    output = [];
    measurements.forEach(function(iMeasurement) {
        if(iMeasurement.parameter == needle) {
            oMeasurement = [];
            time = iMeasurement.time[0] + iMeasurement.time[1] + iMeasurement.time[3] + iMeasurement.time[4];
            time = parseInt(time);
            oMeasurement.push(time);
            oMeasurement.push(iMeasurement.value);
            output.push(oMeasurement); 
        } 
    });
    return output;
}


output = [];

iPatients.forEach(function(iPatient) {
    oPatient = {};

    oPatient.id = iPatient.id;
    oPatient.icuType = iPatient.icuType;
    oPatient.inHopsitalDeath = iPatient.inHospitalDeath;

    oPatient.nimap = processMeasurement(iPatient.measurements,'NIMAP');
    oPatient.hr = processMeasurement(iPatient.measurements,'HR');
    oPatient.temp = processMeasurement(iPatient.measurements,'Temp');

    oPatients.push(oPatient); 
});

